query:
/*+ NoNestLoop(mc t ci) */ select count(*)
from title AS t
inner join movie_companies AS mc
on t.id = mc.movie_id AND t.kind_id = 7 AND t.production_year < 2011 AND mc.company_id > 1886 AND mc.company_type_id > 1
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id < 2476943 AND ci.role_id > 9;
